@githubstatus Restoration work, cheers for good work.<U+0001F604><U+0001F604><U+0001F604>
Thank you very much.
We also inspect the backup mechanism and recovery.

@githubstatus Shouldn't 'failing over' be an Automation process?
- If you have to do it by trigging it manually then its not failing over its just switching to the 'backup/storage/replicas'
- Github should have a much better failover system in place (just my two cents)

@githubstatus Can we push our code now??
It is not updating our build files.
Please let us know the status?
